    <item>
      <title><![CDATA[Izreke.org poslovice]]></title>
      <link><![CDATA[http://www.izreke.org/poslovice.htm]]></link>
      <description>Meanwhile Crassus was killed on Middle East 53 BC in a disastrous military campaign and the Senate got more afraid of Caesar's ambitions. Pompeii sided with the Senate, which on 49 BC ordered Caesar to hand over command over military forces and to return to Rome. Ignoring the command, he led his army across the Rubicon River in Italy and caused a civil war. After Pompeii was killed next year in Egypt, Caesar had no serious enemies. After victory, Rome took a dictatorial direction.&lt;br&gt;&lt;a type="audio/mpeg" href="http://podcasts.odiogo.com/get_mp3.mp3?f=/izreke-org/Izrekeorg-Izrekeorg_poslovice.mp3"&gt;Click here to play&lt;/a&gt;&lt;br&gt;</description>
