    <item>
      <title><![CDATA[Izreke citati]]></title>
      <link><![CDATA[http://www.izreke.org/citati.htm]]></link>
      <description>When he was in Gades, he saw a statue of Alexander the Great and sighed at the thought that Alexander at the age of 30 years has conquered the whole world, while he himself did not achieve anything important. After he returned to Rome,Caesar worked tirelessly to gain reputation. Till 59 BC he became so influential that he was elected for consul, which was the highest function in the Roman Republic. Together with powerful Pompeii and Crassus they founded the Triumvirate, the rule of three that had the highest power. Caesar was appointed proconsul, or governor of the province of Gaul, and was given command of a huge army. From 58. till 49 BC he won a large area on the other side of Alps.&lt;br&gt;&lt;a type="audio/mpeg" href="http://podcasts.odiogo.com/get_mp3.mp3?f=/izreke-org/Izrekeorg-Izreke_citati.mp3"&gt;Click here to play&lt;/a&gt;&lt;br&gt;</description>
