    <item>
      <title><![CDATA[Izreke Citati]]></title>
      <link><![CDATA[http://www.izreke.org/izreke.htm]]></link>
      <description>As a student, while he traveled to study elocution to the Mediterranean island of Rhodes, Caesar was captured by pirates. Who have demanded a ransom of 20 talents, Caesar said that he is worth 50, and swore that, after they get the money, he will come back and crucify all of them. The Pirates thought that he was joking, but when they got the money, previous threat came true, he slit their throats as a sign of kindness. After he barely avoided being killed by the dictator Sulla, Caesar as all the other young aristocrats climbed the ladder from bottom,working in less important republic services. In 70th BC he was elected for quaestor position and sent to the province of Spain.&lt;br&gt;&lt;a type="audio/mpeg" href="http://podcasts.odiogo.com/get_mp3.mp3?f=/izreke-org/Izrekeorg-Izreke_Citati.mp3"&gt;Click here to play&lt;/a&gt;&lt;br&gt;</description>
