    <item>
      <title><![CDATA[Julius Caesar]]></title>
      <link><![CDATA[http://www.izreke.org/]]></link>
      <description>Gaius Julius Caesar was born in a noble family, Julio, around 102 BC. Cognomen, or surname Caesar, meant "Hairy" which was especially inappropriate for Caesar, who was later highly bald. Nomen, or middle name Julius, was the name of the clan, while praenomen Gaius was his personal name.&lt;br&gt;&lt;a type="audio/mpeg" href="http://podcasts.odiogo.com/get_mp3.mp3?f=/izreke-org/Izrekeorg-Julius_Caesar.mp3"&gt;Click here to play&lt;/a&gt;&lt;br&gt;</description>
